CREATE TABLE playlist (
    id      INTEGER PRIMARY KEY AUTOINCREMENT
                    UNIQUE,
    name    TEXT UNIQUE ON CONFLICT ROLLBACK,
    url     TEXT NOT NULL,
    status  INTEGER    DEFAULT (1),
    bitrate INTEGER
);

CREATE TABLE image (
    id    INTEGER REFERENCES playlist (id) ON DELETE CASCADE
                                           ON UPDATE CASCADE,
    image BLOB    DEFAULT (X'')
);


